import React from "react";
//import { render } from "react-dom";
import Highcharts from "highcharts";
import HighchartsReact from "highcharts-react-official";
import mapDataWorld from "./mapDataWorld";
class WorldMap extends React.Component {
  // Load Highcharts Maps as a module
  render() {
  require("highcharts/modules/map")(Highcharts);
  const data = this.props.WorldDataSet;
   // console.log(data)
  // Create the chart
  const mapOptions = {
    title: {
      text: "",
    },
    colorAxis: {
      min: 0,
      stops: [
        [0.2, "#0000FF"],
        [0.4, "#1E90FF)"],
        [0.6, "#00BFFF"],
        [0.8, "#87CEFF"],
        [0.2, "B0E2FF"],
      ],
    },

    tooltip: {
      pointFormat:
        "{point.satname}<br>" +
        "Lat: {point.satlat} " +
        "Lon: {point.satlng}<br>",

      backgroundColor: "rgba(0, 0, 0, 0.85)",
      style: {
        color: "#F0F0F0",
      },
    },

    series: [
      {
        mapData: mapDataWorld,
        name: "Satellites",
        borderColor: "#A0A0A0",
        nullColor: "rgba(200, 200, 200, 0.3)",
        showInLegend: false,

      },
      {
        type: "mappoint",
        name: "Satellite",
        color: "#90ee7e",
        dataLabels: {
          enabled: true,
          format: "{point.type}",
          color: "#F0F0F3",
        },
        marker: {
          lineColor: "#333",
        },
        data: data,
        showInLegend: false,
      },
    ],
  };

  return (
    <div>
      <h1>Highmaps</h1>
      <HighchartsReact
        options={mapOptions}
        constructorType={"mapChart"}
        highcharts={Highcharts}
      />
    </div>
  );
}
}
export default WorldMap;
